    content:string,
    className?:string,
    variant: "h1" | "h2" | "h3" | "h4" | "h5" | "h6" | "subtitle1" | "subtitle2" | "body1" | "body2" | "caption" | "button" | "overline" | "inherit" | undefined
}
const Text=(props:Props) =>{
    return (
       <Typography variant={props.variant} className={props.className}>
           {props.content}
       </Typography>
    );
}

export default Text;
